export default {
  name: "ServicesTableComponent",
  data() {
    return {
      currentPage: 1,
      pageSize: 3,
      services: [
        { id: 1, name: "Serviço 1", description: "Descrição do serviço 1" },
        { id: 2, name: "Serviço 2", description: "Descrição do serviço 2" },
        { id: 3, name: "Serviço 3", description: "Descrição do serviço 3" },
        { id: 4, name: "Serviço 4", description: "Descrição do serviço 4" },
        { id: 5, name: "Serviço 5", description: "Descrição do serviço 5" },
        { id: 6, name: "Serviço 6", description: "Descrição do serviço 6" },
        { id: 7, name: "Serviço 7", description: "Descrição do serviço 7" },
        { id: 8, name: "Serviço 8", description: "Descrição do serviço 8" },
        { id: 9, name: "Serviço 9", description: "Descrição do serviço 9" },
      ],
    };
  },
  computed: {
    paginatedServices() {
      const startIndex = (this.currentPage - 1) * this.pageSize;
      return this.services.slice(startIndex, startIndex + this.pageSize);
    },
    totalPages() {
      return Math.ceil(this.services.length / this.pageSize);
    },
  },
  methods: {
    goToPage(page) {
      this.currentPage = page;
    },
  },
};
